import React from "react";
import { Chart } from "react-chartjs-2";
import faker from "faker";

export default function ReactChart() {

  const labels = [
    "January",
    "February",
    "March",
    "April",
    "May",
    "June",
    "July",
  ];
  const data = {
    labels,
    datasets: [
      {
        type: "line",
        label: "Dataset 1",
        borderColor: "rgb(255, 99, 132)",
        borderWidth: 2,
        fill: false,
        data: [1],
      },
      
    ],
  };
  return <Chart type="bar" data={data} />;
}
